import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import styled from 'styled-components';
import Carta from './components/Carta/Carta.js';
import PantallaInicial from './components/PantallaInicial'; // Importa PantallaInicial
import Login from './components/Login'; // Importa Login
import './App.css';

const Container = styled.div`
  padding: 20px;
`;

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<PantallaInicial />} />
        <Route path="/login" element={<Login />} />
      </Routes>
      <Container>
        <Carta palo="trebol" numero="J" />
      </Container>
    </Router>
  );
};

export default App;
